import React, { Component } from "react";
import {
  CBadge,
  CCard,
  CCardBody,
  CCardHeader,
  CCol,
  CDataTable,
  CRow,
} from "@coreui/react";

class Clientitem extends Component {
  render() {
    return (
      <div className="content-wrapper">
        <br />
        <br />
        <br />

        <CRow>
          <CCol xs="18" lg="12">
            <CCard>
              <CCardHeader>
                Listes des clients
                <DocsLink name="CModal" />
              </CCardHeader>
              <CCardBody>
                <CDataTable
                  items={usersData}
                  fields={fields}
                  itemsPerPage={5}
                  pagination
                  scopedSlots={{
                    status: (item) => (
                      <td>
                        <CBadge color={getBadge(item.status)}>
                          {item.status}
                        </CBadge>
                      </td>
                    ),
                  }}
                />
              </CCardBody>
            </CCard>
          </CCol>
        </CRow>
      </div>
    );
  }
}

export default Clientitem;
